pragma solidity ^0.8.7;

contract FunctionCaller {

    function  callName(address a) public returns (string memory) {
        ItemStorageInterface item = ItemStorageInterface(a);

        item.getDmg();
        return item.name();
    }
}

contract ItemStorageInterface{
    function name() public returns (string memory){}
    function getDmg() public view returns (uint){}
}
